css:
.atom-text-editor,
:host {
  background-color: #ffffff;
  color: #333333;
  font-family: 'Espresso Mono', Inconsolata, Monaco, Consolas, 'Courier New', Courier, monospace;
}
.atom-text-editor .invisible-character,
:host .invisible-character,
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: #e1e1e1;
}
.atom-text-editor .gutter,
:host .gutter {
  background-color: #ffffff;
}
.atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 1;
  color: #777777;
}
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #777777;
}
.atom-text-editor .cursor,
:host .cursor {
  border-color: #535353;
}
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: #c2e8ff;
  border-radius: 2px;
}
.atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  font-weight: bold !important;
  background-color: #F2F3F9;
}
.atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: #F2F3F9 !important;
}
.bracket-matcher .region {
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 2px;
  border: 1px solid #5fafef;
}
.comment {
  color: #adadad;
  font-style: normal;
}
.entity {
  color: #699d36;
}
.entity.class {
  color: #f93232;
}
.keyword {
  color: #626fc9;
}
.storage.type {
  color: #6700b9;
}
.constant {
  color: #f93232;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #5fafef;
}
.variable.this {
  color: #6700b9;
}
.delimiter,
.brace {
  color: #000000;
}
.delimiter.period {
  color: #699d36;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #f93232;
}
.invalid.illegal {
  color: #f93232;
}
.string {
  color: #bc670f;
  background-color: rgba(188, 103, 15, 0.03);
}
.string .constant.character.escape {
  color: #f93232;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #f93232;
}
.css .entity {
  color: #5fafef;
}
.css .property-name {
  color: #f93232;
}
.css .variable {
  color: #699d36;
}
.css .constant,
.css .unit {
  color: #626fc9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.css .quoted {
  color: #e9ad1a;
}
.html .tag,
.xml .tag {
  color: #5fafef;
}
.html .entity,
.xml .entity {
  color: #2f6f9f;
}
.html .entity.name,
.xml .entity.name {
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 3px;
}
.html .comment,
.xml .comment {
  color: #adadad;
}
.html .attribute-name,
.xml .attribute-name {
  color: #5fafef;
}
.html .quoted,
.xml .quoted {
  color: #f93232;
}
.html .quoted .punctuation,
.xml .quoted .punctuation {
  color: #2f6f9f;
}
.html .js .quoted,
.xml .js .quoted {
  color: #e9ad1a;
}
.gfm .link {
  color: #000000;
  font-weight: bold;
}
.gfm .link .entity {
  color: #e9ad1a;
  font-weight: normal;
}
.gfm .link .link {
  color: #699d36;
  font-weight: normal;
}
.gfm .heading {
  font-weight: bold;
  color: #000000;
}
.gfm .list,
.gfm .hr {
  color: #f93232;
}
.gfm .quote {
  font-style: italic;
  color: #2f6f9f;
}
.gfm .raw {
  color: #626fc9;
}
.gfm .raw .support {
  color: #f93232;
  font-weight: bold;
}
.json .punctuation {
  color: #333333;
}
.json .punctuation.separator {
  color: red;
}
.json .quoted {
  color: #2f6f9f;
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 3px;
}
.json .constant {
  color: #626fc9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.yaml .entity.name {
  background-color: rgba(137, 198, 243, 0.1);
}
.yaml .string .punctuation {
  color: #777777;
}
.ruby .entity.name {
  color: #626fc9;
}
.ruby .string {
  color: #f93232;
}
.erb .embedded.erb {
  color: #626fc9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.erb .embedded.erb .variable {
  color: #6700b9;
}
.erb .embedded.erb .punctuation {
  color: #626fc9;
}
